                stiffness:500,
            }
        },
       exit:{
        x:"-100vh",
        opacity:0,
        },
    }
    return(
        <Fragment>
            <motion.div id='MOBILE'
            variants={dropIn}
            initial="hidden"
            animate="visible"
            exit="exit"
            >
             <button onClick={handleClose}id="bb"><i className='fa fa-times'></i></button>
             <div className='S'>
                <input type="text" name="" id="" />

             </div>
            </motion.div>
        </Fragment>
    );
}export default NMOBILE;
